css:
.autoload-images-header {
  background-color: #fff5cf;
  border: 1px solid #c8b46e;
  border-radius: 3px;
  color: rgba(187, 151, 22, 0.92);
  margin: 5px 0;
  padding: 5px 12px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.autoload-images-header .option {
  color: rgba(95, 78, 28, 0.7);
}
.autoload-images-header .option:hover {
  color: rgba(76, 63, 29, 0.88);
}
